378336Font3\"  >Special Handling used only within particular \'need to know\' compartments\n</span ></li >\n<li  class=\"text378336Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text378336CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text378336Font3\"  >Accountable Material such as TOP SECRET material and CABINET material, and\n</span ></li >\n<li  class=\"text378336Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text378336CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text378336Font3\"  >Releasability Indicators such as Eyes Only, RELEASABLE TO (REL), and Australian Government Access Only (AGAO)) \n</span ></li >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
